 export function getRecipes(inclusions, exclusions, pantry, count) {
 const API_URL =
    "localhost:4567/recipes";
  const params = {
      inclusions, exclusions, pantry, count
  }

   fetch(API_URL, {
    method: "POST",
    headers: {
      "content-type": "application/json"
    },
    body: JSON.stringify(params)
  })
    .then(res => {
        console.log(res)
      return res.json();
    })
    .catch("Error: Something went wrong.");

}

getRecipes([], [], [], 3);
